import React from 'react'

const Home = () => {
  return (
    <div  >
      <img src="images/food.png" className='img-fluid' alt="food image"></img>
      <div className="position-relative overlay d-flex flex-column">
      <h3 className="text-white fw-bold">Food App</h3>
      <h1 className="text-white fw bold">Why stay hungry when you can order from Bella Onojie</h1>
      </div>
    </div>
  )
}

export default Home
